import React from 'react';
import { LoginButton } from '../../components';
import { Link } from 'react-router-dom';
import './Nav.css';

const Nav = () => {
  return (
    <div className="nav">
      <ul className="nav-links">
        <li className="nav-login nav-link">
          <LoginButton />
        </li>
        <li className="nav-logo nav-link">
          <Link to="/">Gov Resource</Link>
        </li>
      </ul>
    </div>
  );
};

export default Nav;
